static QCString symbs = "#&*+;-./:<=>?@\\^~";

int quoted_end(  QCString text, int begin) {
 int ch;
  int i = begin + 1;
  if (text[begin] != '\'')
    return -1;
  while ((ch = text[i++])) {
    if (ch == '\0')
      return -1;
    if (ch == '\\') {
      i++;
    } else if (ch == '\'') {
      ch = text[i];
      if (ch == '\0')
        return i;
      if (ch == '\'') {
        i++;
      }
      return i;
    }
  }
  return -1;
}

int get_atom( yyscan_t yyscanner, QCString text) {
 int i = 0, ch, level = 0;
 restart:
  ch = text[i++];
  if (ch == '\0')
    return -1;
  if (ch == '\'') {
    int o = quoted_end( text, i - 1);
    return o;
  } else if (ch == '(') {
    level++;
    goto restart;
  } else if (isalpha(ch) || ch == '_' || ch == '$') {

    while (isalnum((ch = text[i])) || ch == '_')
      i++;
  } else if (symbs.contains(ch)) {
    while (symbs.contains((ch = text[i]))) {
      i++;
    }
    if (level == 0 && i > 1 && text[i - 1] == '/' && isdigit(ch))
      i--;
  } else
    return -1;
  while (level > 0) {
    while (isblank(ch))
      ch = text[i++];
    if (ch == ')') {
      if (--level == 0)
        return i + 1;
    } else
      return -1;
  }
  return i;
  }

